import React, {Component} from 'react';

class Progressbar extends Component {
    render() {
        return (
            <div>
                <div className="progress-container"><a href="#top" />
                    <div className="progress-bars" id="myBar" />
                </div>
            </div>
        );
    }
}

export default Progressbar;
